Description:
These are provisional representations of Public Waters Basins (lakes, wetlands) and Watercourses (streams, altered channels) as depicted on the scanned paper regulatory maps and lists known as Public Waters Inventory (PWI). Public Waters (formerly called Protected Waters) are defined in MN Rule and are protected by specific permitting requirements.

Permits for Water Appropriation, Public Waters Work and Dam Safety are available from the <b>MNDNR Permitting and Reporting System (MPARS)</b>:  http://www.dnr.state.mn.us/mpars/index.html

-------------------------------------------------------------------------------------------------------------------------------------
<b>Minnesota Administrative Rules - Chapter 6115 Public Water Resources</b>
http://www.revisor.mn.gov/rules/?id=6115

<b>Public Waters Inventory</b>
http://www.revisor.mn.gov/statutes/?id=103G.201

<b>Definitions</b>  http://www.revisor.mn.gov/rules/?id=6120.3000

 <i>Subd. 15 Public waters. </i>(a) "Public waters" means:

<ul>(1) water basins assigned a <b>shoreland management classification</b> by the commissioner under sections 103F.201 to 103F.221;<b> see</b> http://www.revisor.mn.gov/rules/?id=6120.3000 

(2) waters of the state that have been finally determined to be public waters or navigable waters by a court of competent jurisdiction;

(3) meandered lakes, excluding lakes that have been legally drained;

(4) water basins previously designated by the commissioner for management for a specific purpose such as trout lakes and game lakes pursuant to applicable laws;

(5) water basins designated as scientific and natural areas under section 84.033;

(6) water basins located within and totally surrounded by publicly owned lands;

(7) water basins where the state of Minnesota or the federal government holds title to any of the beds or shores, unless the owner declares that the water is not necessary for the purposes of the public ownership;

(8) water basins where there is a publicly owned and controlled access that is intended to provide for public access to the water basin;

(9) natural and altered watercourses with a total drainage area greater than two square miles;

(10) natural and altered watercourses designated by the commissioner as trout streams; and

(11) public waters wetlands, unless the statute expressly states otherwise.

(b) Public waters are not determined exclusively by the proprietorship of the underlying, overlying, or surrounding land or by whether it is a body or stream of water that was navigable in fact or susceptible of being used as a highway for commerce at the time this state was admitted to the union.</ul>

This dataset was created by the MRCC, a joint collaborative project involving the technical and managerial GIS staff from the Seven Metropolitan Counties (Anoka, Carver, Dakota, Hennepin, Ramsey, Scott and Washington), the Metropolitan Emergency Services Board, the Metropolitan Council and MnGeo with the primary goal to develop a road centerline data model and dataset that meets core business needs of local governments and regional interests.  Core needs this dataset are intended to satisfy include:

- Vehicular routing;
- Address geocoding;
- Next Generation 911 call routing and location validation;
- Emergency services dispatching;
- Linear referencing uses;
- Cartographic representation of road features;


The MRCC encourages other counties and stakeholders across Minnesota to build upon the work of the MRCC and not have to replicate the process of model development. The MRCC does not claim to have the full knowledge of the unique road data needs to be anticipated from stakeholders in Greater Minnesota such as national and state forest roadway, tribal nation roadways and so on. The MRCC endeavors to have this effort augment and support larger statewide road dataset development efforts in the future.

